    return (
        <div className="w-1/4 h-full flex items-center justify-center pt-2">
            <div className="w-1/3 h-full font-MaplestoryBold font-extrabold text-5xl text-palePupple text-stroke-2 text-stroke-white">우</div>
            <div className="w-1/3 h-full font-MaplestoryBold text-5xl text-palePupple text-stroke-2 text-stroke-white">아</div>
            <div className="w-1/3 h-full font-MaplestoryBold text-5xl text-palePupple text-stroke-2 text-stroke-white">한</div>
        </div>
    )
}

export default Title;
